import React from 'react';

const name = "Carlos Carrasquillo",
      phone = "(787) 668-8096",
      email = "c.carrasquillo@ufl.edu";

function getName() {
    return <p>{name}</p>
}

function getPhone() {
    return <p>{phone}</p>
}

function getEmail() {
    return <p>{email}</p>
}


export default getName;
